\nimport h5py\nimport os\nimport dask.array as da\nimport dask\nfrom dask.distributed import performance_report, Client\nimport json \nfrom dask_ml.decomposition import InSituIncrementalPCA\nimport time \nimport yaml\n\n#Scheduler file name and configuration file\nscheduler_info = 'scheduler.json'\nconfig_file = 'config.yml'\n\ndef connect(sched_file):\n    with open(sched_file) as f:\n        s = json.load(f)\n    adr = s[\"address\"]\n    try:\n        client  = Client(adr) #, timeout=60, heartbeat_interval=10)\n        print(\"client connected\", flush=True)\n    except Exception as e:\n        print(\"retrying ...\", flush=True)\n        client = Client(adr) #, timeout=60, heartbeat_interval=10)\n    return client\n\n\n# Get client\nclient = connect(scheduler_info)\ndask.config.set({\"distributed.deploy.lost-worker-timeout\": 60, \"distributed.workers.memory.spill\":0.97, \"distributed.workers.memory.target\":0.95, \"distributed.workers.memory.terminate\":0.99 })\n\nwith open(config_file) as file:\n    data = yaml.load(file, Loader=yaml.FullLoader)\n    chun= data[\"chunks\"]\n\nchuny=int(chun[\"width\"])\nchunx=int(chun[\"height\"])\nprint(\"chunks\", chunx, chuny)\n\n\n\nwith performance_report(filename=\"dask-report.html\"): \n    t = time.time()\n    f = h5py.File('data.h5', 'r') \n    d = f['local_t']\n    print(d, flush=True)\n    gt = da.from_array(d, chunks=(1,chunx,chuny))\n    \n    pca=InSituIncrementalPCA(n_components=2,copy=False, svd_solver='randomized')\n    print(\"pca, \", pca, flush=True)\n\n    l = pca.fit(gt, [\"t\", \"X\", \"Y\"], [\"X\"], [\"Y\"])\n    #print(\"this is l :\", l, flush=True)\n\n    cpt = [pca.explained_variance_ ,   pca.singular_values_ ]\n    # Submit the task graph to the scheduler\n\n    explained_variance , singular_values = client.persist(cpt)\n    #arrays.validate_contract()   \n    explained_variance , singular_values = client.compute([explained_variance ,singular_values])\n    print(\"explained_variance ,singular_values\",explained_variance.result() ,\" and \" , singular_values.result(), flush=True )\n\nprint(\"Done in \", time.time() -t , \" secondes\")\n    \nos.remove('data.h5') \nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"callback":{"id":"1138"}},"id":"1139","type":"TapTool"},{"attributes":{"data":{"bandwidth":{"__ndarray__":"lZSoBsZHwkEQcwrEK1nKQRvtvVqIPsdBRBh+366fuUFaA670OnSyQdpJzMD29s5BBlY/nLTAwEFoId9hEs3MQVGQYi/fy7tBuxgKnxbGu0ElqkcVbeS6Qc3NWEcwaNBB","dtype":"float64","order":"little","shape":[12]},"bandwidth_text":["584.97 MiB","843.15 MiB","743.82 MiB","409.98 MiB","295.26 MiB","0.97 GiB","536.09 MiB","0.90 GiB","444.74 MiB","444.38 MiB","430.28 MiB","1.03 GiB"],"destination":["tcp://172.21.11.162:33297","tcp://172.21.11.157:36521","tcp://172.21.11.162:40834","tcp://172.21.11.157:37520","tcp://172.21.11.157:37520","tcp://172.21.11.162:40834","tcp://172.21.11.162:40834","tcp://172.21.11.162:33297","tcp://172.21.11.157:36521","tcp://172.21.11.157:36521","tcp://172.21.11.157:37520","tcp://172.21.11.162:33297"],"source":["tcp://172.21.11.157:36521","tcp://172.21.11.157:37520","tcp://172.21.11.157:37520","tcp://172.21.11.157:36521","tcp://172.21.11.162:40834","tcp://172.21.11.162:33297","tcp://172.21.11.157:36521","tcp://172.21.11.162:40834","tcp://172.21.11.162:33297","tcp://172.21.11.162:40834","tcp://172.21.11.162:33297","tcp://172.21.11.157:37520"]},"selected":{"id":"1507"},"selection_policy":{"id":"1506"}},"id":"1150","type":"ColumnDataSource"},{"attributes":{},"id":"1141","type":"ResetTool"},{"attributes":{"child":{"id":"1039"},"title":"Scheduler Profile (administrative)"},"id":"1405","type":"Panel"},{"attributes":{"below":[{"id":"1259"}],"center":[{"id":"1262"},{"id":"1266"},{"id":"1280"}],"height":150,"left":[{"id":"1263"}],"renderers":[{"id":"1278"}],"sizing_mode":"stretch_both","title":{"id":"1250"},"toolbar":{"id":"1270"},"toolbar_location":"above","x_range":{"id":"1215"},"x_scale":{"id":"1255"},"y_range":{"id"
